  public void testSignatureEncoding() {

    assertEquals(52*2, expected.length);

    try {

      // Deserialize auth and verify that it matches the plaintext information.

      @SuppressWarnings("resource")
      ContentInfo ci = (ContentInfo) new PEMParser(new StringReader(auth)).readObject();

      CMSSignedData cms = new CMSSignedData(ci);

      ByteArrayOutputStream out = new ByteArrayOutputStream();

      cms.getSignedContent().write(out);

      byte [] bytes = out.toByteArray();

      // the data should be a string that is a series of base64 encoded bigintegers separated by spaces

      String base64 = new String(bytes);

      List<BigInteger> ret = new ArrayList<BigInteger>();

      for( String bn : base64.split(" ") ) {
        byte[] hex = Base64.decode(bn.getBytes(), Base64.DEFAULT);


        // We add an extra byte here to ensure it is interpreted as a positive number
        byte[] array = new byte[hex.length + 1];
        ByteBuffer bbuf = ByteBuffer.wrap(array);
        bbuf.put((byte)0);
        bbuf.put(hex);

        BigInteger in = new BigInteger(array);
        ret.add( in );
      }

      for (int i=0; i < ret.size(); i++) {
        //System.out.println(expected[i]);
        //System.out.println(ret.get(i).toString(16));
        assertEquals(expected[i], ret.get(i).toString(16));
      }

      assertEquals(expected.length, ret.size());


    } catch (Exception e) {
      System.out.println(e);
      e.printStackTrace();
      assertTrue(false);
    }
  }
  
  private BigInteger base64toBigInt(String base64) {

    byte[] hex = Base64.decode(base64.getBytes(), Base64.DEFAULT);


    // We add an extra byte here to ensure it is interpreted as a positive number
    byte[] array = new byte[hex.length + 1];
    ByteBuffer bbuf = ByteBuffer.wrap(array);
    bbuf.put((byte)0);
    bbuf.put(hex);

    return new BigInteger(array);
  }
  
  public void testRecomputeSecondHalf() throws Exception {
    // recompute h'(h(u)^rus)

    String rus = "waZTysCy7UeEwCRgEpmlWDRMiTI=\n";
    String u = "ErP-XwZGdX";
    String hashU = "";
    String hashUpow = "72702611343e87dd1b42efdc132cdbed549ff93cfd77bd656cd6ca03091ffe484bc1142a117550a8d2cabf87ea0c79c7df1e32a08b79bb8d44790f0784385cbce21247773926a925dda0b5fdd30520c9c7d952db13005f5bf54af70fcfd28c183491c1209f0ccf5cdab38ba4e79a152d54b97c2111626522cd30510ab63e7bbe";
    String expectedOutput = "";

    ATWPSICA test = new ATWPSICA(null, null);
    
    // start with h(u)
    BigInteger cHu = test.hash(u);
    Log.i(TAG, "computed h(u): "+cHu.toString(16));
    assertEquals(hashU, cHu.toString());
    
    // now h(u)^rus
    BigInteger chrus = cHu.modPow(base64toBigInt(rus), new BigInteger(p, 16));
    assertEquals(hashUpow, chrus.toString(16));
    
    // then last hash
    BigInteger hprime = test.hashPrime(chrus.toString(16));
    assertEquals(expectedOutput, hprime.toString());

  }
  
